INSERT INTO `articles` (`id`, `title`, `picture`, `description`, `category_id`, `views`, `publish_date`) VALUES
(1, 'الاطلاق الرسمي لموقع موتسيكلات', '871e7ccbc6f666a6a16780d2c6626187.png', '<p>بسم الله الرحمن الرحيم .... </p>\n\n<p>زوار موقع موتسيكلات .... اليوم 15 من مايو 2015، تم الاعلان عن الاطلاق الرسمي لموقع موتسيكلات في الوطن العربي ... لقد استمر العمل على تطوير وانشاء الموقع أشهر عديدة، حاولنا الوصول الى افضل شكل ومحتوى لنساعد هواة الدراجات النارية في الوطن العربي على تحقيق أكبر استفادة من موقعنا. </p>\n\n<p> </p>\n\n<p>موتسيكلات .. موقع معنى بكل ما يخص عالم الدراجات النارية، ويقدم العديد من الخدمات لأعضائة وزوارة، من هذه الخدمات، خدمة البيع والشراء، حيث يتيح الموقع امكانية اضافة وعرض أي نوع من الدراجات النارية للبيع ( الجديد والمستعمل )، ويستطيع الزائر البحث بشكل سهل وميسر وبامكانات بحث متقدمة.</p>\n\n<p>يتميز البحث عن الدراجات النارية المستعملة، بعرض النتائج بشكل مباشر وجذاب ، مما يساعد المشترى على تحديد مراده بسهوله ويسر.</p>\n\n<p>أيضا ... يحتوى موقع موتسيكلات على قاعدة بينات قوية خاصة بكل ما يتعلق بالدراجات النارية من ملحقات وقطع غيار ومعدات أمن وسلامة سواء الجديد منها أو المستعمل.</p>\n\n<p>توفير خدمة المجموعات .... يستطيع الاعضاء انشاء مجموعات ( Groups ) خاصة بموضوع معين يقوموا بتبادل الاراء والحوارات الفعالة بداخلة كل على حسب اهتماماته. ( قريباً )</p>\n\n<p>خدمة ترتيب اللقاءات والاحداث ( Events ) .... الاعلان عن لقاءات الركوب الجماعية لمالكي الدراجات النارية حيث يصل الحدث لكافة المشتركين في الموقع على بريدهم الالكتروني مما يساعد على نشره بشكل افضل لتحقيق الغرض من زيادة عدد الاعضاء المشتركين في الحدث... ويتم متابعة الحدث من ادارة الموقع حتى نهايته. ( قريباً )</p>\n\n<p>خدمات التدريب ... تحديد مواعيد لدورات تعليم القيادة الآمنه سواء للافراد أو المجموعات على يد محترفين ذوي خبرة وباع طويل في عالم الدراجات النارية .</p>\n\n<p>المقالات .... عرض مقالات تعليمية ، أراء ، تحليلات وغيرها من المواضيع الهامة التي تفيد راكبي الدراجات النارية.</p>\n\n<p>والعديد من الخدمات التي نتمنى أن تحوز على رضاء الزوار......</p>\n\n<p>يخدم الموقع كل محبي الدراجات النارية في الوطن العربي كاملا ... ولا يقتصر على بلد معين.</p>\n\n<p>يسعدنا تلقي مقترحاتكم ، وكذلك الخدمات التي تحبون أن تجدوها على موتسيكلات ليكون افضل موقع عربي متخصص معنى براكبي الدراجات النارية.</p>', 1, 938, '2015-05-15 09:44:58'),
(2, 'تنظيف الدراجــــات الناريــة', '89b132cff67b487447a91db9ff986dd7.jpg', '<p dir="RTL">التنظيف المنتظم يجعل دراجتك تبدو كالجديدة، ومن شأنه تفادي تعرضها للتلف.</p>\n\n<p dir="RTL">هناك سببان وجيهان يجعلان عملية تنظيف الدراجات النارية أولوية لدى جميع مالكي الدراجات: تضمن الصيانة المنتظمة ليس فقط لاستمرار عمل الدراجة النارية بصورة سلسة وتقليل خطر حدوث تلف فحسب، ولكنها تحافظ أيضاً على أن تبدو الدراجة في أبهى صورها. رغم أن تنظيف الدراجة النارية يستنفذ الوقت والجهد، فيمكنك اختصار الوقت المطلوب عن طريق القيام بعمليات تنظيف صغيرة بصفة منتظمة كجزء من جدول تنظيفك العادي. وهذا أسهل بكثير من التعامل مع الأوساخ المتراكمة الجافة التي تكونت على مدار الشهر ومحاولة التخلص منها مرة واحدة.</p>\n\n<p dir="RTL"> </p>\n\n<p dir="RTL">يجب استخدام قطع الإسفنج عند تنظيف الأجزاء الكبيرة في الدراجة النارية التي لا تتعرض غالباً للأوساخ اليابسة ولا تكون عرضة للبلي بسهولة.</p>\n\n<p dir="RTL"><span dir="LTR">1 </span>    الهيكل والإطار الرئيسي للدراجة النارية أو البخارية، وليس أي مكان آخر، قوم باستخدام محلول صابوني (مكوّن من منظف دراجات خاص) إما من الأمام إلى الخلف أو من الأعلى إلى الأسفل. يرجع الأمر لتفضيلك الشخصي.</p>\n\n<p dir="RTL"><span dir="LTR">2 </span>    بالنسبة للبقع الصعبة والأوساخ الجافة، قد تحتاج إلى الاستمرار في وضع الإسفنجة على الأوساخ لمدة دقيقة أو دقيقتين لطريتها.</p>\n\n<p dir="RTL"> <span dir="LTR">3</span>    عندما تتسخ الإسفنجة أو تمتص كمية من الأتربة الصلبة، استبدلها بإسفنجة نظيفة، نظراً لأن قطع الإسفنج المتسخة يمكنها خدش الطلاء والمعدن. كما يجد بعض مالكي الدراجات أن مناشف الصحون الناعمة بديل جيد عن الإسفنجة.</p>\n\n<p dir="RTL"> <span dir="LTR">4</span>  اشطف بالماء النظيف وتذكر تنفيذ ذلك برفق، وإذا كنت تعتزم باستخدام خرطوم فلا تقوم بتوجيه الرشاش مباشرة إلى أي منطقة قد تكون معرضة للتلف.</p>\n\n<p dir="RTL"> </p>\n\n<p dir="RTL">يجب عليك استخدام الفرشاة مع جميع أجزاء الدراجة النارية الأخرى. فهي لا تجعل عملية التنظيف أسهل فحسب لسهولة وصولها إلى الأركان والفتحات، بل تتمتع بالقدرة على حماية الأجزاء الرقيقة في الدراجة من الحك العنيف.</p>\n\n<p dir="RTL"><span dir="LTR">1</span>     يمكنك تنظيف المصدات وقدمات المكبح باستخدام الفرشاة. استخدم فرشاة مخصصة لتنظيف الدراجات أو أي نوع آخر من الفراشي متوسطة إلى خشنة الشعر، مثل فرشاة أسنان قديمة أو فرشاة غسل الصحون أو فرشاة طلاء صغيرة.</p>\n\n<p dir="RTL"><span dir="LTR">2</span>     يمكن كذلك استخدام الفراشي في تنظيف أجزاء العادم – مثل الأنابيب – والمحرك، ولكن نظراً لأن هذه المناطق معرضة للسخونة، يجب أن تتذكر أمرين: دع الدراجة تبرد تماماً بعد استخدامها قبل الشروع في تنظيفها، وتوقع استغراق مزيد من الوقت والجهد في تلك المناطق، لأن الحرارة تساهم في جعل الأوساخ قاسية وصعبة الإزالة.</p>\n\n<p dir="RTL"><span dir="LTR">3</span>     استخدم الفرشاة لوضع مزيل الشحوم على الجنزير عند تنظيفه، واستخدميها مع المزيّت أيضاً. للحصول على أفضل النتائج، بمجرد وضع المزيّت بين جميع وصلات الجنزير، استخدم قطعة قماش من الألياف الصناعية الدقيقة لدهن الزيت على الجنزير.</p>\n\n<p dir="RTL"><span dir="LTR">4</span>   لا تنسي تنظيف مناطق مثل واقيات الوحل، ولوحة الأرقام، ومحاور الارتكاز، ولكن توخي الحذر عند تنظيف المنطقة المحيطة بحلقات منع التسرب. وتجنب حكها قدر الإمكان لكيلا ترتخي.</p>', 4, 1598, '2015-05-15 10:10:35'),
(3, 'شرح مهارة ال Counter Steering', '61b52dbb6fb66a97e52541b6399500f8.jpg', '<p dir="RTL">أحد أهم المهارات التي يجب اتقانها عند قيادة دراجتك النارية لضمان السلامة أثناء الميل والانحناء خلال قيادتك للدراجة النارية، تذكر جيداً .... يجب أن تكون سرعتك اكثر من 20 ميل في الساعة ( 32 كيلومتر في الساعة ) حتى تستطيع تطبيق هذه المهارة بأمان. </p>\n\n<p dir="RTL">تتلخص المهارة في عكس اتجاه دورانك  ( للاطار الأمامي للدراجة النارية ) حتى تستجيب الدراجة النارية بسهولة ويسر لاتجاه الدوران .</p>\n\n<p dir="RTL"> </p>\n\n<p dir="RTL"><strong>الشرح :</strong></p>\n\n<p dir="RTL"> عند الرغبة في الدوران ناحية اليسار تقوم بتوجيه عمود القيادة قليلا في اتجاه اليمين ( من مقبض اليد اليسرى )... ستجد الدراجة النارية تسير في الاتجاه المرغوب مباشرة ( يساراً ) وستشعر بثبات الدراجة النارية اثناء الميل خصوصا على السرعات العالية.</p>\n\n<p dir="RTL"> </p>\n\n<p dir="RTL"><strong>نصائح :</strong></p>\n\n<p dir="RTL">1  لا تستخدم هذا الاسلوب على السرعات المنخفضة جدا ( اقل من 20 ميل في الساعة ).</p>\n\n<p dir="RTL">2  حاول التدريب على هذا الاسلوب قليلا في طريق خال من المارة حتى تتقن العمل به قبل السير في الطرقات .</p>\n\n<p dir="RTL"> </p>\n\n<p dir="RTL">نتمنى لك قيادة آمنة وممتعة </p>', 2, 1348, '2015-05-15 10:39:38');
