(8, 'Honda Steed vlx 400cc 1998', 6, 115, 20000, 1, 'هوندا ستيد 400 موديل 98\nبحاله ممتازه , فابريكا بالكامل , شكمان تعديل مكرونة , مريات تعديل , انجيبين جارد بالدوسات , اسكرينه - كاوتش جديد خلفي وامامي ياباني - سيرفيس كامل\nلاتحتاج لأي مصاريف نهائيا\nمرور بين السرايات.\nالسعر قابل للتفاوض بعد المعاينة.\nللإستعلام:\n01225281281\n01222637197', 3, 10, '7', 3, 2, 40000, 1998, 'bdb88aaca47214f991aee43764b00c11.jpg', '2df86ae823dd3ac4e92833d63d242aff.jpg', '8291284149ebbfc1e101fb9081cc1d02.jpg', 'e55b0f1f7099830d6a6300ef5bb78a59.jpg', 912, 3, '2015-05-17 22:02:20', '2016-12-04 00:31:27', 1),
(9, 'Honda silver wing 600 ABS 2003', 6, 108, 28000, 1, 'Honda Silver Wing 600 cc\nModel 2003\nفرامل ABS,\nعداد 22000 كم\nرخصة سنتين وشهور تقريبا,\nالسعر قابل للتفاوض المعقول.\nللإستفسار يرجى الإتصال على:\n01100860285', 3, 10, '11', 3, 2, 21500, 2003, '515916d95de99f8447187f0a056ad577.jpeg', '34f85145b409ef6433543865999222f6.jpeg', '3ab0fa5dc6330f54002a0db03713c6d5.jpeg', 'eee94fc8b331aeb363d80287775c653b.jpeg', 1443, 8, '2015-10-24 17:35:03', '2016-12-02 21:01:06', 1),
(10, 'Yamaha Dragstar 650cc Classic 2007', 16, 243, 25000, 1, 'موديل 2007 إفرج جمركي شهر 5 /2015 \nخارج من الجمرك من أيام\nلم تستخدم في مصر\nجادون مسطره تعديل\nعداد RPM تعديل\nمقابض تعديل\nكرسي تعديل\nدواسات كفوف تعديل\nبطارية جديدة\nلا تحتاج مصاريف.\nالسعر النهائي بعد المعاينة.\nللإستعلام إتصل على:\n01222637197', 3, 10, '12', 2, 2, 3000, 2007, 'ea4c61d235e694943d301a6e435f06ff.jpg', '2981a8d828811b9f18c3231ebd9e5c0b.jpg', 'fed08ba7e8fe5cb5a40777475c8d43fc.jpg', '', 383, 1, '2015-05-17 23:11:53', '2016-11-30 18:32:26', 1),
