(14, 'Suzuki Bandit 600 model 2003', 13, 199, 28000, 1, 'الحالة ممتازة فابريكه بالكامل لاتحتاج الى أي مصاريف\nالسعر قابل للتفاوض البسيط.\nللإستعلام :\n01225281281\n01222637197', 3, 10, '11', 3, 2, 19000, 2003, '6faf09bec5df41e7e9d3863637973646.jpg', 'ce57f013c679368313ab0e3a5d399905.jpg', '4bf7416a1bf1f47d602cb5b0f177d2ce.jpg', 'c58541c5b444da756566814616abc55e.jpg', 384, 0, '2015-05-18 16:59:09', '2016-11-25 06:54:16', 1),
(15, 'Yamaha Raptor 700cc Model 2009', 16, 252, 60000, 1, 'ياماها رابتور 700 موديل 2009.\nالحاله واضحه كما في الصور\nإفراج جمركي من أيام أول شهر 5 / 2015\nلم يستخدم في مصر نهائي\nمزوده بكمبيوتر تعديل\nعلبة تعديل Sparks Racing Exhaust.\nبطارية جديدة \nجرابات حافظة للمساعدين ShockWears\nشنطة عدة كاملة ياماها الأصلية\nالسعر النهائي بعد المعاينة.\nللإستعلام إتصل على:\n01222637197', 3, 10, '13', 5, 2, 3000, 2009, '8a71f0a0b0f8a08bfa7448aec2dc5db6.jpg', 'e19d21aa12bb2d0d67a127f146d37a0a.jpg', 'c40aa12761468a9281500e3fd597c3c8.jpg', '08e1975c2d58d9980a8801da56b52cd1.jpg', 854, 0, '2015-05-18 17:23:18', '2016-12-02 06:08:58', 1),
