(15, 'Sherlyn', 'qk34td2im@hotmail.com', 'George,Also, the US was never "a democracy" in the sense of Athens, but between 1828 and 1932 it was certainly a lot more like Athens than anyone in the founding generation wanted it to be.The US before the Progressive reforms was not utterly politicized, and the US since the New Deal is not utterly dezclitioiped.  But the difference remains enormous.  Except among a small left-wing elite, who are either aristos or wannabes who are aping their views, mass political organization in the US today is nonexistent.  Tocqueville might as well have visited another planet.', '2016-10-20 09:59:22'),
