INSERT INTO `slider` (`id`, `title`, `description`, `picture`, `publish_date`) VALUES
(1, 'مقـالات موقع موتسيكلات', '<p>أقوى المقالات والتقييمات الفنية للدراجات النارية .... شرح لأساليب القيادة الآمنة .... مقالات تعليمية وتثقيفية عن رياضة الدراجات النارية .... نصائح وارشادات في كافة المواضيع ... أرشيف كامل لكافة المقالات </p>', 'b163778fb8d75db5400e1249a2f1f6d7.png', '2015-05-15 09:29:28'),
(2, '.... الموقع الأول عربياً', '<p><span >أول موقع عربي شامل معنى بعالم الدراجات النارية وكل ما يخصها ... العديد من الخدمات التي يقدمها موقع موتسيكلات تهدف الى نشر هواية الدراجات النارية وتوسيع قاعدة الممارسيين لهذه الهواية في الوطن العربي .. والحفاظ على أمن وسلامة الجميع</span></p>', '28490e5116cf6dc4fa23f1b79541ddc4.png', '2015-05-15 08:56:32'),
(3, 'اعرض دراجتك النارية للبيع', '<p>أول متجر عربي يشمل كافة خدمات البيع والشراء لهواة الدراجات النارية في الوطن العربي كافة ... تقسييم العارضين تبعا لطبيعة البائع ... اساليب بحث متقدمة تسهل الوصول لكافة المنتجات سواء دراجات نارية أو ملحقات وقطع غيار بكافة أنواعها </p>', 'ed69c68ac320a651676af4e83790ca20.png', '2015-05-15 09:23:46');
